def convertInDicofTuples(mergedList):
    global d
    d1 = defaultdict(list)
    for k, v in mergedList:
        d1[k].append(v)
    d = dict((k, tuple(v)) for k, v in d1.items())
    return d


def convertDicToList(l):
    d = {}
    for key, val in l:
        d.setdefault(key, []).append(val)
    return d


